import React from 'react';
import { Container, Typography } from '@mui/material';

const Home = () => {
  return (
    <Container>
      <Typography variant="h3">Welcome to My Basecamp</Typography>
      <Typography variant="body1">Manage your projects and teams effectively.</Typography>
    </Container>
  );
};

export default Home;
